import Header from './components/Header';
import Footer from './components/Footer';
import Home from './components/Home';
function App() {

  const obj={title:"Hello",desc:"Yello"};
  return (
    <div className="App">
      <Header/>
      <Home obj={obj}/>
      <Footer/>
    </div>
  );
}

export default App;
